import React from 'react'
import { View, Text, TouchableOpacity, StyleSheet} from 'react-native'

import {HomeScreenButtons} from '../components/index';

export default function homeScreen() {
      return (
            <View>
                  <Image source={require("../../src/assets/splash.png")} />
                  <HomeScreenButtons buttonVals={[
                        {title: "Screen1", img:"../assets/icon.png"},
                        {title: "Screen2", img:"../assets/icon.png"},
                        {title: "Screen3", img:"../assets/icon.png"}
                  ]}/>
            </View>
      )
}
